// App.js
import Navbar from './components/Navbar';
import Sidebar from './components/Sidebar';
import ImageSection from './components/ImageSection';
import StatusText from './components/StatusText';
import Footer from './components/Footer';

function App() {
  return (
    <div className="bg-white p-4 font-sans min-h-screen">
      <div className="max-w-screen-lg mx-auto border border-black">
        <Navbar />
        <div className="grid grid-cols-5 border-b border-black min-h-[300px]">
          <div className="col-span-1 border-r border-black">
            <Sidebar />
          </div>
          <div className="col-span-4 p-4">
            <ImageSection />
          </div>
        </div>
        <StatusText />
        <Footer />
      </div>
    </div>
  );
}

export default App;
